import React from 'react';
import './App.scss';
import Navbar from './components/Navbar'
import { Routes, Route } from 'react-router-dom'

function App() {
  return (
    <Routes>
      <Route path="/" element={<Navbar/>} />
    </Routes>
  );
}

export default App;
